import React, { Component } from "react";

class Clients extends Component {
  render() {
    const clients = [
      {
        id: 4494948449,
        firstName: "Jordan",
        lastName: "Lewin",
        email: "jordanl@kimo.com",
        phone: "444-444-5555",
        balance: 30
      }
    ];
    return (
      <div>
        <h1>Clients</h1>
      </div>
    );
  }
}

export default Clients;
